"<!DOCTYPE html>
<html>
<head>
    <title>Sample Page</title>
    <script type="text/javascript">
        function updateMessage() {
            var userInput = document.getElementById('userInput').value;
            document.getElementById('displayArea').innerHTML = 'Hello, ' + userInput + '!';

            // Send a message back to Swift
            if (window.webkit && window.webkit.messageHandlers.iOSCallback) {
                window.webkit.messageHandlers.iOSCallback.postMessage(userInput);
            }
        }
    </script>
</head>
<body>
    <h1>Welcome to the Sample App</h1>
    <input type="text" id="userInput" placeholder="Enter your name">
    <button onclick="updateMessage()">Greet Me</button>
    <p id="displayArea"></p>
</body>
</html>"
